import React from 'react';
import { Marker } from 'google-maps-react';

class CustomMarker extends Marker {
    render() {
        return (
            <div style={{color: 'red', width: '20px', height: '20px',   transform: 'translate(-50%, -50%)'}}>
            </div>
        )
    }
}

export default CustomMarker;
